function echo(n, d, sound) {
    /* replace dummy below with your solution */
    function create_echo(n_delay) {
        if (n_delay === 0) {
            return list(sound);
        } else {
            // We first create the nth delay sound n * d length
            const delay_sound = silence_sound(n_delay * d);
            // We make a softer version of the original sound by 2^-n
            const softer_sound = make_sound(
                t => get_wave(sound)(t) / math_pow(2, n_delay), 
                get_duration(sound)
            );
            // We combine the 2 sounds to get the echo
            const echo_sound = consecutively(list(delay_sound, softer_sound));

            // We create a list of nth echo, (n-1)th echo, ..., original sound
            // using recursion
            return pair(
                       echo_sound,
                       create_echo(n_delay - 1)
                   );
        }
    }

    // We use simultaneously to combine the list of all the echos together
    return simultaneously(create_echo(n));
}

// Test
const test_sound = sine_sound(800, 0.2);
play(echo(5, 0.4, test_sound));

