function n_of_n_stream() {
    // YOUR SOLUTION HERE
    function n_stream(n, count) {
        return n === count
            ? n_stream(n + 1, 0)
            : pair(n, () => n_stream(n, count + 1));
    }


    return n_stream(1, 0);
}

