// TASK 2

function d_merge(xs, ys) {

    //

*
    // Set the head of the new merged list to the one with the smaller head
    let merged = head(ys) > head(xs) ? xs : ys;
    let curr = merged;
    // Get the tail of the smaller head
    if (head(ys) > head(xs)) {
        xs = tail(xs);
    } else {
        ys = tail(ys);
    }

    // Set the tail of the new merged list to the list with the next smallest head
    while (!is_null(xs) && !is_null(ys)) {
        if (head(ys) > head(xs)) {
            set_tail(curr, xs);
            curr = tail(curr);
            xs = tail(xs);
        } else {
            set_tail(curr, ys);
            curr = tail(curr);
            ys = tail(ys);
        }
    }

    // Once one of the lists is null, we add the other to the back of the new merged list
    if (is_null(xs)) {
        set_tail(curr, ys);
    } else {
        set_tail(curr, xs);
    }

    return merged;
}

